import React from 'react'
import {useNavigate} from "react-router-dom"

export default function MovieDetails() {
  const navigate = useNavigate();

  return (
    <div>
      <h1>MovieDetails</h1>
      <button title="go" onClick={()=> navigate('/home')}/>
    </div>
  )
}
